import fetcher from '../fetcher';

const getFilterApartments = async (query) => {
    try{
        const {data} = await fetcher.get(`/apartments/${query}`);
        // console.log("hereeee", data[0])
        return data[0];
    }catch(error){
        throw new Error(`Cant get apartments`);
    }
}

const getCountries = async () => {
    try {
        const countries = await fetcher.get('/countries');
        console.log("hereeee", countries.data)
        return countries.data;
    } catch(error){
        console.log(error)
    }
} 

export {getCountries};
